  true,\n\t\"url\": null,\n\t\"notes\": \"<p>This release contains the Basic Stand
  Alone (BSA) Skilled Nursing Facility (SNF) Beneficiary Public Use Files (PUF) with
  information from Medicare SNF claims. The CMS BSA SNF Beneficiary PUF is a beneficiary-level
  file in which each record is a beneficiary who had at least one SNF claim from a
  random 5 percent sample of Medicare beneficiaries. There are some demographic and
  claim-related variables provided in this PUF.</p>n\",\n\t\"license_title\": \"Other
